import React from "react";

export default function KaWai(props) {
    const {story} = props;
    return (
        <div>
            <div className="section1">
                    {story.slice(0,3)}
                    <img src={require("../../photos/KaWai/KaWai1.png")} />
            </div>
        </div>
    )
}
